INSERT INTO `form_sqlcontent` VALUES ('1598250492489699329', '2022-12-01 17:39:46', 'system', '2022-12-01 17:39:46', 'system', '<sql test=\"fversion==null or fversion==\'\'\"> select\r\n    FID, FCreationDate, FCreateBy, FLastUpdateDate, FLastUpdateBy, FProcessName, FProcessTypeCode, FProcessCode, FIsReminder, FReminderMode, FStartType, FStartName, FStartID, FIsEndReminder, FIsCopy, FDescription, FVersion,FromID,FState,fbusinessmoudle,fbusinessmoduleid,flowicon,fprocess_bid\r\n    from tapp_process where (FState=2 or FState=1 or FState=3)\r\n    <if test=\"fid != null\">\r\n        and FID = #{fid}\r\n    </if>\r\n    <if test=\"fromid != null\">\r\n        and FromID = #{fromid}\r\n    </if>\r\n    <if test=\"fcreationdate != null\">\r\n        and FCreationDate = #{fcreationdate}\r\n    </if>\r\n    <if test=\"fcreateby != null and fcreateby != \'\'\">\r\n        and FCreateBy = #{fcreateby}\r\n    </if>\r\n    <if test=\"flastupdatedate != null\">\r\n        and FLastUpdateDate = #{flastupdatedate}\r\n    </if>\r\n    <if test=\"flastupdateby != null and flastupdateby != \'\'\">\r\n        and FLastUpdateBy = #{flastupdateby}\r\n    </if>\r\n    <if test=\"fprocessname != null and fprocessname != \'\'\">\r\n        and FProcessName like CONCAT(\'\',#{fprocessname},\'%\')\r\n    </if>\r\n    <if test=\"fprocesstypecode != null and fprocesstypecode != \'\'\">\r\n        and FProcessTypeCode = #{fprocesstypecode}\r\n    </if>\r\n    <if test=\"fprocesscode != null and fprocesscode != \'\'\">\r\n        and FProcessCode like CONCAT(\'\',#{fprocesscode},\'%\')\r\n    </if>\r\n    <if test=\"fisreminder != null\">\r\n        and FIsReminder = #{fisreminder}\r\n    </if>\r\n    <if test=\"fremindermode != null and fremindermode != \'\'\">\r\n        and FReminderMode = #{fremindermode}\r\n    </if>\r\n    <if test=\"fstarttype != null and fstarttype != \'\'\">\r\n        and FStartType = #{fstarttype}\r\n    </if>\r\n    <if test=\"fstartname != null and fstartname != \'\'\">\r\n        and FStartName = #{fstartname}\r\n    </if>\r\n    <if test=\"fstartid != null and fstartid != \'\'\">\r\n        and FStartID = #{fstartid}\r\n    </if>\r\n    <if test=\"fisendreminder != null\">\r\n        and FIsEndReminder = #{fisendreminder}\r\n    </if>\r\n    <if test=\"fiscopy != null\">\r\n        and FIsCopy = #{fiscopy}\r\n    </if>\r\n    <if test=\"fdescription != null and fdescription != \'\'\">\r\n        and FDescription = #{fdescription}\r\n    </if>\r\n    <if test=\"fbusinessmoudle != null and fbusinessmoudle != \'\'\">\r\n        and fbusinessmoudle = #{fbusinessmoudle}\r\n    </if>\r\n    <if test=\"fprocessBid != null\">\r\n        and fprocess_bid = #{fprocessBid}\r\n    </if>\r\n    <if test=\"fbusinessmoduleid != null and fbusinessmoduleid != \'\'\">\r\n        and fbusinessmoduleid = #{fbusinessmoduleid}\r\n    </if>\r\n    <if test=\"fversion != null\">\r\n        and FVersion = #{fversion}\r\n    </if>\r\n\r\n    order by FLastUpdateDate desc\r\n</sql>\r\n<sql test=\"fversio!=null or fversion!=\'\'\"></sql>');
INSERT INTO `form_sqlcontent` VALUES ('1598253087010656258', '2022-12-01 17:50:05', 'system', '2022-12-01 17:50:05', 'system', '<sql test=\"fversion==null or fversion==\'\'\"> select\r\n    *\r\n    from oa_process where (State=2 or State=1 or State=3)\r\n    <if test=\"processname != null and processname != \'\'\">\r\n        and ProcessName like CONCAT(\'\',#{processname},\'%\')\r\n    </if>\r\n    <if test=\"processtypecode != null and processtypecode != \'\'\">\r\n        and ProcessTypeCode = #{processtypecode}\r\n    </if>\r\n    <if test=\"processcode != null and processcode != \'\'\">\r\n        and ProcessCode like CONCAT(\'\',#{processcode},\'%\')\r\n    </if>\r\n    <if test=\"version != null\">\r\n        and Version = #{version}\r\n    </if> order by update_date desc\r\n</sql>\r\n<sql test=\"fversio!=null or fversion!=\'\'\">select\r\n    *\r\n    from oa_process where (State=2 or State=1 or State=3)\r\n    <if test=\"processname != null and processname != \'\'\">\r\n        and ProcessName like CONCAT(\'\',#{processname},\'%\')\r\n    </if>\r\n    <if test=\"processtypecode != null and processtypecode != \'\'\">\r\n        and ProcessTypeCode = #{processtypecode}\r\n    </if>\r\n    <if test=\"processcode != null and processcode != \'\'\">\r\n        and ProcessCode like CONCAT(\'\',#{processcode},\'%\')\r\n    </if>\r\n    <if test=\"version != null\">\r\n        and Version = #{version}\r\n    </if> order by update_date desc</sql>');
