INSERT INTO `form_sqlcontent` VALUES ('1598603795903840258', '2022-12-02 17:03:40', 'system', '2022-12-02 17:03:40', 'system', '<sql test=\"fversion==null or fversion==\'\'\">\r\n    select oa_process.*from oa_process inner join (\r\n    select max(version) as version,process_bid from oa_process where (State=2 or State=1 or State=3) GROUP BY process_bid\r\n    ) as processdata on processdata.process_bid=oa_process.process_bid and\r\n    oa_process.version=processdata.version\r\n <where>\r\n    <if test=\"processname != null and processname != \'\'\">\r\n        and ProcessName like CONCAT(\'\',#{processname},\'%\')\r\n    </if>\r\n    <if test=\"processtypecode != null and processtypecode != \'\'\">\r\n        and ProcessTypeCode = #{processtypecode}\r\n    </if>\r\n    <if test=\"processcode != null and processcode != \'\'\">\r\n        and ProcessCode like CONCAT(\'\',#{processcode},\'%\')\r\n    </if>\r\n     </where>\r\n    order by update_date desc\r\n</sql>\r\n<sql test=\"fversio!=null or fversion!=\'\'\">select\r\n    *\r\n    from oa_process where (State=2 or State=1 or State=3)\r\n    <if test=\"processname != null and processname != \'\'\">\r\n        and ProcessName like CONCAT(\'\',#{processname},\'%\')\r\n    </if>\r\n    <if test=\"processtypecode != null and processtypecode != \'\'\">\r\n        and ProcessTypeCode = #{processtypecode}\r\n    </if>\r\n    <if test=\"processcode != null and processcode != \'\'\">\r\n        and ProcessCode like CONCAT(\'\',#{processcode},\'%\')\r\n    </if>\r\n    <if test=\"version != null\">\r\n        and Version = #{version}\r\n    </if> order by update_date desc\r\n</sql>');
