INSERT INTO `form_sqlcontent` VALUES ('1598956626935025666', '2022-12-03 16:25:42', 'system', '2022-12-03 16:25:42', 'system', '    select Oa_process.*from Oa_process inner join (\r\n    select\r\n    max(version) as version,process_bid from Oa_process\r\n    GROUP BY process_bid\r\n    ) as processdata on processdata.process_bid=Oa_process.process_bid and\r\n    Oa_process.version=processdata.version\r\n    where State=2');
